import React from "react";
import { useParams } from "react-router";

const QuoteDetail = () => {
  const params = useParams();
  return <React.Fragment><h1>QUOTE DETAIL{params.quoteId}</h1>;</React.Fragment>
};
export default QuoteDetail;
